$(document).ready(function(){$.ajax({type:"get",url:defaultUrl+"setup/dealer/specific/user",success:function(e){e.length>1?$.each(e,function(e,t){$('select[name="dealer_id"]').append($("<option>",{value:t.id,text:t.nama}))}):($("#company-select-box").remove(),$("#submit-btn").remove())},error:function(e){swal({type:"error",title:"Mohon refresh kembali halaman ini."})}}),$.getJSON("https://talaikis.com/api/quotes/random/",function(e){$("#quote").append('"'+e.quote+'"'),$("#author").append(e.author)}),$("#set-session-form").submit(function(e){e.preventDefault();var t=$(this);$.ajax({type:"post",url:t.attr("action"),data:t.serializeArray(),success:function(e){swal({type:"success",title:"Sukses"}),location.reload()},error:function(e){swal({type:"info",title:"Refresh kembali page"})}})})});